#!/bin/sh

partno() {
	disk="${1}"
	part="${2}"

	if [ $(echo "$disk" | grep mmcblk) ]; then
		echo "${disk}p${part}"
	else
		echo "${disk}${part}"
	fi
}

extract() {
	line=`awk '/^__ROOTFS__/ { print NR + 1; exit 0; }' ${1}`
	outdir="${2}"
	mkdir -p "${outdir}"
	tail -n+${line} "${1}" | base64 -d | gunzip | tar xf - -C "${outdir}"
}

flash() {
	disk="${1}"
}

extract "${0}" outdir/

exit 0

